import React from 'react';
import Link from 'next/link'

const Navegacion = () => {
    return ( 
        <nav class = "d-flex flex-row bd-highlight mb-3 justify-content-start">
            <Link href = "/index" class="p-2 bd-highlight">Index</Link>
            <Link href = "/Medicinales" class="p-2 bd-highlight">Index</Link>
            <Link href = "/Alimentos" class="p-2 bd-highlight">Index</Link>
            <Link href = "/Decorativas" class="p-2 bd-highlight">Index</Link>
        </nav>
     );
}

 
export default Navegacion;
